// Traverse a single tree
inline double traverseTree(const TreeNode* tree, int tree_size, const double* x) {
    int node_id = 0;
    while (node_id >= 0 && node_id < tree_size) {
        const TreeNode& node = tree[node_id];
        if (node.feature == -1) {
            return node.value;  // Leaf node
        }
        if (x[node.feature] < node.threshold) {
            node_id = node.left;
        } else {
            node_id = node.right;
        }
    }
    return 0.0;  // Should not reach here
}

// Predict function
// Input: full feature vector [base(4093) + cascade(13) + LSFER(54) + physics(10) = 4170]
// Output: deltaHc in kJ/mol
// NOTE: XGBoost leaf values already include learning rate! Do NOT multiply by LEARNING_RATE.
inline double predict(const double* full_features) {
    // Select features using FEATURE_MASK
    double x[N_FEATURES];
    for (int i = 0; i < N_FEATURES; ++i) {
        int idx = FEATURE_MASK[i];
        if (idx >= 0 && idx < TOTAL_FEATURE_COUNT) {
            x[i] = full_features[idx];
        } else {
            x[i] = 0.0;
        }
    }
    
    // Sum predictions from all trees
    double sum = BASE_SCORE;
    // NOTE: XGBoost leaf values already include learning rate!
    for (int t = 0; t < N_TREES; ++t) {
        sum += traverseTree(TREES[t], TREE_SIZES[t], x);  // Direct sum, no LR multiplication!
    }
    return sum;
}

